import React from "react";
import { Link } from "react-router-dom";
import { FaChessBoard } from "react-icons/fa";

const Home = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Welcome to GameBot</h1>
      <p>Click an icon to start playing</p>
      <Link to="/chess">
        <FaChessBoard />
      </Link>
    </div>
  );
};

export default Home;
